import React, { useState } from 'react'
import './Projects.css'

export default function Projects() {
    const data = [
        {name: 'Museam', html: true, react: false, link: 'https://notsoname.github.io/museum/'},
        {name: 'Momentum', html: true, react: false, link: 'https://notsoname.github.io/momentum/'},
        {name: 'Movie APP', html: false, react: true, link: 'https://notsoname.github.io/movieAPP/'},
    ]
    const [filter, setFilter] = useState('all')

    const filterProjects = (items, filter) => {
        switch (filter) {
            case 'html':
                return items.filter(item => item.html);
            case 'react':
                return items.filter(item => item.react);
            default:
                return items
        }
    }

    const onFilterSelect = (filter) => {
        setFilter(filter)
    }
    const visibleData = filterProjects(data, filter);
    return (
        <div className='projects'>
            <button onClick={onFilterSelect} className='projects-select'>All</button>
            <button onClick={onFilterSelect} className='projects-select'>HTML + CSS + JS</button>
            <button onClick={onFilterSelect} className='projects-select'>React</button>
        </div>
    )
}
